INSERT INTO `article` VALUES ('1', '1', '总规则说明', '总规则说明', '<p>幸运28游戏:</p><p>北京幸运28开奖结果来源于国家福利彩票北京快乐8(官网)开奖号码,从早上9:05至23:55,每五分钟一期不停开奖</p><p>加拿大幸运28开奖结果来源于加拿大快乐8(官网)开奖号码,全天24小时,每三分钟一期不停开奖。&lt;br/&gt;</p><p>总共有28个数字,从00依次到27。</p><p>00-13为小,14-27为大,奇数为单,偶数为双;</p><p>组合:01-03-05-07-09-11-13为小单,</p><p>00-02-04-06-08-10-12为小双,</p><p>15-17-19-21-23-25-27为大单,</p><p>14-16-18-20-22-24-26为大双,</p><p>00-01-02-03-04-05为极小,</p><p>22-23-24-25-26-27为极大。</p><p>特码：从00依次到27</p><p><br/></p><p>幸运28游戏规则:</p><p>1.大小单双【2倍】</p><p>2.组合【4.1倍】</p><p>3.极大极小【11倍】</p><p>4.特码赔率表</p><p>00 27--(188倍)&amp;nbsp;01 26--(100倍)</p><p>02 25--(25倍)&amp;nbsp;03 24--(25倍)</p><p>04 23--(20倍)&amp;nbsp;05 22--(20倍)</p><p>06 21--(14倍)&amp;nbsp;07 20--(14倍)</p><p>08 19--(13倍)&amp;nbsp;09 18--(13倍)</p><p>10 17--(12倍)&amp;nbsp;11 16--(12倍)</p><p>12 15--(11倍)&amp;nbsp;13 14--(11倍)</p><p>5.特殊号码：13/14</p><p>遇开特殊号码13：投注单,小,小单回本</p><p>遇开特殊号码14：投注双,大,大双回本</p><p>6.以上赔率均含本金</p><p>7.普通会员房:单注10起,大小单双2000封顶,组合1000封顶,特码极大小500封顶,总注5000封顶</p><p>贵宾会员房:单注50起,大小单双10000封顶,组合5000封顶,特码极大小2000封顶,总注30000封顶</p><p>vip会员房:单注500起,大小单双60000封顶,组合20000封顶,特码极大小10000封顶,总注150000封顶</p><p>8.下注格式:</p><p>每次只能单项下注,可以多次下注,不能改注,如下错注，先取消再重新下注。</p><p>大小单双如:在投注框里输入【单100】然后点击【投注】确认</p><p>下注组合如:在投注框里输入【小单100】然后点击【投注】确认</p><p>下注特码如:在投注框里输入【11/100】然后点击【投注】确认</p><p>上下分:点击【上下分】选择支付方式付款成功后,在金额框里输入上下分金额后点击【提交】</p><p>注:所有格式一律金额在后才有效,否则系统无法识别。</p><p>9.上分一倍流水方可下分,《组合单点倍投不得超过五把》</p><p>10.注:如果遇到平台系统故障、网络问题、未开奖 则所有下注金额全部无效,系统恢复后全部退回本金</p><p>11.注:本平台严禁大小单双互投刷流水,一经发现冻结帐号,并追究法律责任！</p><p>需要帮助请添加客服微信:</p><p>需要帮助请添加QQ客服:</p>', '1514739600');
INSERT INTO `article` VALUES ('2', '3', '普通房间规则说明', '普通房间规则说明2', '<p><span style=\"color: rgb(255, 0, 0);\">普通厅规则</span></p><p>1:进入普通会员厅金额限制(0) 最低10起投</p><p>大小单双【2000封顶】</p><p>组合 【1000封顶】</p><p>特码极大小【1000封顶】</p><p>总注【5000封顶】</p><p>2:以下赔率含本金</p><p>大小单双【2倍】</p><p>组合 【4.1倍】</p><p>特码极大小【11倍】</p><p>总注【11倍-188倍】</p><p>3:特殊号码:13/14</p><p>遇到开特殊号码13:投注单、小、小单回本</p><p>遇到开特殊号码14:投注双、大、大双回本</p><p>4:所有上分金额需投注一倍流水方可下分。</p><p>注:如遇到平台故障 网络问题 没开奖 则所有下注金额全部无效，系统恢复后全部退还本金。</p><p><br/></p>', '1514739600');
