
-- -----------------------------
-- Table structure for `accumulation`
-- -----------------------------
DROP TABLE IF EXISTS `accumulation`;
CREATE TABLE `accumulation` (
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `in_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '系统充值',
  `online_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '在线充值',
  `out_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '取款',
  `use_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '消费',
  `give` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '赠送',
  `debit` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '扣款',
  `winning` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '中奖',
  `refund` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '退款',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '当时账户余额(变动之前的数据)',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '累加时间',
  KEY `user_id` (`user_id`),
  KEY `create_time` (`create_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户数据累加表';

-- -----------------------------
-- Records of `accumulation`
-- -----------------------------

