-- -----------------------------
-- Table structure for `betting`
-- -----------------------------
DROP TABLE IF EXISTS `betting`;
CREATE TABLE `betting` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `content` text NOT NULL COMMENT '下注内容',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '下注总金额',
  `expect` int(11) NOT NULL DEFAULT '0' COMMENT '期号',
  `type` int(3) NOT NULL DEFAULT '0' COMMENT '彩种编码',
  `win` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '奖金',
  `state` int(1) NOT NULL DEFAULT '0' COMMENT '是否派奖',
  `other` varchar(50) DEFAULT NULL COMMENT '备用字段(28房间)',
  `explain` varchar(50) DEFAULT NULL COMMENT '说明使用字段',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '投注时间',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `expect` (`expect`)
) ENGINE=InnoDB AUTO_INCREMENT=294 DEFAULT CHARSET=utf8 COMMENT='投注记录';

-- -----------------------------
-- Records of `betting`
-- -----------------------------

-- -----------------------------
-- Table structure for `capital_audit`
-- -----------------------------
DROP TABLE IF EXISTS `capital_audit`;
CREATE TABLE `capital_audit` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `money` decimal(10,2) DEFAULT '0.00' COMMENT '金额',
  `type` int(1) NOT NULL DEFAULT '0' COMMENT '0:充值 1:取款',
  `state` int(1) NOT NULL DEFAULT '0' COMMENT '0:未处理1:已处理2:结束',
  `remarks` varchar(50) DEFAULT NULL COMMENT '备注',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '提交时间',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `type` (`type`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='资金审核表';


-- -----------------------------
-- Table structure for `capital_audit_message`
-- -----------------------------
DROP TABLE IF EXISTS `capital_audit_message`;
CREATE TABLE `capital_audit_message` (
  `audit_id` int(11) NOT NULL DEFAULT '0',
  `content` varchar(255) NOT NULL DEFAULT '',
  `create_time` int(11) NOT NULL DEFAULT '0'
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='资金审核会话表';


-- -----------------------------
-- Table structure for `capital_detail`
-- -----------------------------
DROP TABLE IF EXISTS `capital_detail`;
CREATE TABLE `capital_detail` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `type` int(2) NOT NULL DEFAULT '0' COMMENT '0:下注 1;提现 2:充值 3:中奖 4:扣款 5:赠送 6:退款',
  `explain` varchar(50) DEFAULT NULL COMMENT '说明',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '操作时间',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `type` (`type`),
  KEY `create_time` (`create_time`)
) ENGINE=InnoDB AUTO_INCREMENT=360 DEFAULT CHARSET=utf8 COMMENT='资金明细表';

-- -----------------------------
-- Records of `capital_detail`
-- -----------------------------

